import React from 'react';
import LatestComic from "../../assets/comics/1.jpg";


class Comic extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			file: []
		}
	}

	render() {
		return(
			<div>
				<p>
					<img className={"App-logo"} src={LatestComic} alt="VTC internal design" />
				</p>
				<button>
					&lt;derp> First
				</button>
				<button>
					Previous
				</button>
				<button>
					Random
				</button>
				<button>
					Next
				</button>
				<button>
					Newest
				</button>
			</div>

		)
	}
}
export default Comic;
